import React from "react";
import "../page/style/HomeLayout.css";
import PostDoor from "../components/PostDoor";
function HomeLayout() {
  return (
    <div className="HomeLayout">
      <div className="userBox">userBox</div>
      <div className="postBox">
        <PostDoor className="postDoor"></PostDoor>
        <PostDoor></PostDoor>
      </div>
      <div className="hotBox">Hotbox</div>
    </div>
  );
}

export default HomeLayout;
